import React from "react";
import classes from './Button.module.css'

const Button = props => {
    const cls = [
        'fa',
        classes.Button,
        classes[props.type]
    ]

    return (
        <button
            onClick={props.onClick}
            className={cls.join(' ')}
            disabled={props.disabled}
        >
            {props.children}
        </button>
    )
}
export default Button
